export function calculateScore(setAnswer) {
  const spec = [4, 5, 7, 8];
  let totalScore = 0;

  Object.keys(setAnswer).forEach((questionId) => {
      const value = setAnswer[questionId];
      let score = 0;

      if (spec.includes(parseInt(questionId, 10))) { // questionId를 정수로 변환
          switch (value) {
              case '전혀':
                  score = 3;
                  break;
              case '가끔':
                  score = 2;
                  break;
              case '자주':
                  score = 1;
                  break;
              case '항상':
                  score = 0;
                  break;
              default:
                  score = 0;
          }
      } else {
          switch (value) {
              case '전혀':
                  score = 0;
                  break;
              case '가끔':
                  score = 1;
                  break;
              case '자주':
                  score = 2;
                  break;
              case '항상':
                  score = 3;
                  break;
              default:
                  score = 0;
          }
      }

      totalScore += score;
  });

  return totalScore;
}
